import React from "react";
import classes from "./Navbar.module.css";

const Navbar= () => {
  return (

    <nav className="navbar">
    <h1>MAX </h1>
    <div className="links">
      <a href="/">Home</a>
      <a href="/create" style={{ 
        color: 'white', 
        backgroundColor: '#f1356d',
        borderRadius: '8px' 
      }}>New Blog</a>
    </div>
  </nav>
    
  );
}

export default Navbar;
